about:
Meghan Miller believes in providing an oasis for busy people around the world to pause, to reflect, and to tune in to their own greatness. She guides you into a healthy lifestyle full of grace and elegance! In doing so her followers can change their lives, their families lives and impact their communities. 

She began her wellness journey as a Pilates instructor and expanded her toolbox over the years to heal/cope from a mental health disorder of Bipolar 1. If you are feeling overwhelmed by life’s demands, her services and teachings aim to introduce clarity and self-motivation. She holds certifications in Personal Training (ACE), Nutrition Coaching (Precision Nutrition), Trigger Point Therapy, Reiki, Journal Therapy, Life Purpose Coaching, Meditation Practitioner and EFT/TFT Tapping. 
